import React from "react";
import { withGoogleMap, GoogleMap, Marker } from "react-google-maps";

const Map = props => {
    console.log(props);
    return (
        withGoogleMap(
            <GoogleMap defaultZoom={8} defaultCenter={{ lat: -34.397, lng: 150.644 }}>
                {props.isMarkerShown && (
                    <Marker position={{ lat: -34.397, lng: 150.644 }} />
                )}
            </GoogleMap>)
    );
};

export default Map;
